import React, { useEffect, useState } from "react";
import "./main.css";
import "./processing.css";
import { Link, useNavigate } from "react-router-dom";

function Processing() {
  const [status, setStatus] = useState({
    objectDetection: "pending",
    musicRecommendation: "pending",
    emotionAnalysis: "pending",
    storyGeneration: "pending",
  });
  const navigate = useNavigate();

  // Map status to icons
  const statusIcons = {
    completed: `${process.env.PUBLIC_URL}/fyp-images/tick.png`,
    processing: `${process.env.PUBLIC_URL}/fyp-images/inprogress.png`,
    pending: `${process.env.PUBLIC_URL}/fyp-images/pending.jpeg`,
  };

  const keyword = localStorage.getItem("selectedKeyword") || "";

  useEffect(() => {
    const interval = setInterval(async () => {
      try {
        const response = await fetch("http://127.0.0.1:5000/status"); // backend endpoint to get status
        if (!response.ok) throw new Error("Failed to fetch status");
        const data = await response.json();

        setStatus(data);

        // Check if all steps are completed
        if (
          data.objectDetection === "completed" &&
          data.musicRecommendation === "completed" &&
          data.emotionAnalysis === "completed" &&
          data.storyGeneration === "completed"
        ) {
          clearInterval(interval);
          navigate("/result"); // move to result page
        }
      } catch (error) {
        console.error("Error fetching status:", error);
      }
    }, 1000); // poll every second

    return () => clearInterval(interval);
  }, [navigate]);

  // Calculate progress (simple average of steps)
  const progress = Object.values(status).filter(s => s === "completed").length / 4 * 100;

  return (
    <div className="keyword-page">
      <h1 className="top-heading">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
          width="50"
          height="55"
          alt="MoodMelody Logo"
        />{" "}
        MoodMelody
      </h1>

      <p className="top-Description">AI Processing in Progress</p>

      <div className="uploads-flex">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/vedio.jpg`}
          alt="Video"
          className="vedio-icon"
        />
        <h3 className="keyword-heading">
          Keyword = “{keyword || "—"}”
        </h3>
      </div>

      <div className="progress-bar">
        <div
          className="progress-fill"
          style={{ width: `${progress}%` }}
        ></div>
      </div>

      <div className="processing-content">
        <div className="processing-steps">
          <div className="step">
            <img src={statusIcons[status.objectDetection]} alt="Status" className="step-icon" />
            <p>Object Detection</p>
          </div>
          <div className="step">
            <img src={statusIcons[status.musicRecommendation]} alt="Status" className="step-icon" />
            <p>Music Recommendation</p>
          </div>
          <div className="step">
            <img src={statusIcons[status.emotionAnalysis]} alt="Status" className="step-icon" />
            <p>Facial Expression Analysis</p>
          </div>
          <div className="step">
            <img src={statusIcons[status.storyGeneration]} alt="Status" className="step-icon" />
            <p>Story Generation</p>
          </div>
        </div>

        <div className="status-section">
          <p>{status.objectDetection}</p>
          <p>{status.musicRecommendation}</p>
          <p>{status.emotionAnalysis}</p>
          <p>{status.storyGeneration}</p>
        </div>
      </div>

      <button className="cancel-btn" onClick={() => navigate("/keyword")}>
        Cancel Processing
      </button>
    </div>
  );
}

export default Processing;
